Jetpack Handbook（B5相当で132p）はAndroidアプリ開発を加速するJetpackを取り上げたプログラミング解説書です。
Jetpackライブラリのうちアプリ開発に大きな影響を与える、注目すべき技術を取り上げました。今後のアプリ開発を支える必携の一冊です。

Android Architecture Componentsだけでなく、NavigationやWorkManager、KTXを網羅した全7章を収録しています。


【目次紹介】
詳細な目次、本文はサンプルでご確認ください。

