Android技術に関わる人は必携の一冊になりました。モバイル開発者向けの一冊です。効率よく最新技術をゲットしよう！

技術の夏、未来の夏。（B5相当で140p）はAndroid Pの最新機能をとりあげたはじめてのプログラミング解説書です。
今後のモバイルアプリ開発を支える新機能だけでなく機械学習、新しいマテリアルデザインなどモバイル分野で活きる知識が得られます。

Slices、アニメーションを作るMotionLayout、新しいマテリアルデザインなどAndroid Pに関連した最新技術の解説、全7章を収録しています。

